import React from 'react';
import Cards from './Cards';
import { FormattedMessage } from 'react-intl'; 
import ironing from '../../images/ironing.jpg';


export default function PricesIroning() {

  const title1 = <FormattedMessage id="ironing.title1" />
  const title2 = <FormattedMessage id="ironing.title2" />
  
  
    return (
      <div style={{backgroundColor:'#0E1521', color:'white'}} >
        <div className='container'>
          <div className="row ">
            <div className='col-6'>
          <Cards image={ironing} title={title1} />
          </div>
          <div className='col-6'>
          <Cards title={title2} />
          </div>
          </div>
        </div>
      </div>
    );
  }
